import React from "react";
import "./Login.css";

const Login = () => {
  return (
    <div className="wrapper">
            <div className="container1">

         <h2>Signup page</h2>
            <form>
            <label htmlFor="name">Name:</label>
            <input type="text" id="name" placeholder="Enter name" />
</form>


        </div>
     

     </div>
  );
};

export default Login;
